import React, { Component } from "react";

class Pagination extends Component {
  render() {
    console.log(props);
    return (
      <nav aria-label="Page navigation example">
        <ul class="pagination">
          <li class="page-item">
            <a class="page-link" href="#">
              1
            </a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Pagination;
